import "./App.css";
import image from "./SaeidImage.png"
export default function App(){
    return(
        <div className={"card"}>
            <Avatar/>
            <div className="data">
                <Intro/>
                <SkillList/>
            </div>
        </div>
    )
}

function Avatar() {
    return(
        <img className={"avatar"} src={image} alt="Saeid Avatar Image"/>
    )
}
function Intro(){
    return (
        <div>
            <h1>Saeid Ebrahimi</h1>
            <p>I am front-end and WordPress developer. I use my 8 years coding Background to bring you Modern and Minimalist Websites and Webapps. My profession field is  building personal and companies websites.</p>
        </div>
    )
}
function SkillList(){
    return (
        <div className={"skill-list"}>
            <Skill skill={"Next.js"} emoji={"üòé"} color={"orange"}/>
            <Skill skill={"React"} emoji={"üòé"} color={"white"}/>
            <Skill skill={"TypeScript"} emoji={"üëΩ"} color={"aliceblue"} />
            <Skill skill={"JavaScript"} emoji={"üòÅ"} color={""} />
            <Skill skill={"Bootstrap"} emoji={"üòä"} cor={""} />
            <Skill skill={"Git & Github"} emoji={"üòä"} colr={""} />
            <Skill skill={"NPM"} emoji={"üòä"} color={""} />
            <Skill skill={"SASS"} emoji={"üòä"} colr={""} />
            <Skill skill={"HTML & CSS"} emoji={"üòâ"} colo r={""} />
            <Skill skill={"Python"} emoji={"üëÄ"} colo r={""} />
            <Skill skill={"C++"} emoji={"üëÅÔ∏è"} colr={""} />


        </div>
    )
}
function Skill(props){
    return (
        <div className="skill">
            <span>{props.skill}</span>
            <span>{props.emoji}</span>

        </div>
    )
}
